import React from "react";

const Cities = ({ lang_result }) => {
  const renderlangresult = lang_result.map((item, i) => {
    return (
      <li key={i}>
        item.full_name
      </li>
    );
  });
  return <ul>{renderlangresult}</ul>;
};

export default Cities;
